import NavbarSty from "../components/Navbar.js";
import styled from "styled-components";

export default function Cart() {
  return (
    <>
      <NavbarSty />
      <ProdDataSty>
        <ProdSty>
          <ContainerItem>
            <img src="https://cf.shopee.com.br/file/d9f93981e1839c51ec55b3a6d05571fc" />
            <h1>hhhggggggggggggggggggggggggggggggghkjhkhkjhjkh</h1>
            <button>-</button>
            <h2>00</h2>
            <button>+</button>
            <h3>R$00.00</h3>
          </ContainerItem>
        </ProdSty>
        <ContainerData>
          <div>
            <form>
              <input
                name="address"
                type="text"
                placeholder="Endereço"
                required
              />
              <input
                name="number"
                type="number"
                placeholder="Número"
                required
              />
              <input
                name="cep"
                type="number"
                placeholder="CEP"
                required
              />
              <input
                name="city"
                type="text"
                placeholder="Cidade"
                required
              />
                <input
                name="state"
                type="text"
                placeholder="Estado"
                required
              />
              <button>Finalizar Compra</button>
            </form>
          </div>
        </ContainerData>
      </ProdDataSty>
    </>
  );
}

const ProdDataSty = styled.div`
  margin: 89px;
  padding-top: 30px;
  display: flex;
  justify-content: center;
`;

const ProdSty = styled.div`
  width: 400px;
  height: 500px;
  margin-right: 100px;
  background-color: #add8e6;
  border-radius: 20px;
  overflow: auto;
`;

const ContainerItem = styled.div`
  width: 370px;
  height: 100px;
  border-radius: 5px;
  background-color: #ffffff;
  margin: 20px auto;
  display: flex;
  align-items: center;

  img {
    height: 90px;
    margin: 10px;
  }

  h1 {
    width: 170px;
    font-size: 22px;
    margin-right: 6px;
    word-wrap: break-word;
  }

  h2 {
    margin: 3px;
    font-size: 20px;
  }
`;

const ContainerData = styled.div`
  div {
    width: 400px;
    height: 300px;
    border-radius: 20px;
    background-color: aqua;
  }

  form{
    display: flex;
    flex-direction: column;
  }

  input{
    width: 100px;
  }
`;
